@FieldDiamond @TigersHistory I saw McGwire hit one over the LF roof in April 1997. It was a Sunday, one of these days where the air was heavy — warm if you were in direct sunlight — and chilly in the shade.

Big Mac crushed it; Higginson never moved fr. his stance.

BTW, Mac looked a lot like Paul Bunyan. JS
